INSERT INTO `blogs` (`blog_id`, `blog_status`, `blog_title`, `blog_image`, `blog_description`, `blog_person`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 1, 'Restaurant Business', '2023-03-13-640edfa801c2c.png', 'Restaurant Business is the leading media brand in the commercial foodservice industry, with a focus on entrepreneurship, innovation and growth.\r\n\r\nRestaurant Business has its own page on food that talks about current food trends and recipes to keep your menu fresh. In addition, they also provide their readers with market benchmarks, innovative ideas, new concepts and trends, and other important insights.', 'Only Dhosa', '2023-03-13 08:32:40', '2023-03-13 08:36:39', NULL),
(2, 1, 'Salmon Burgers', '2023-03-16-6412e22503b23.png', 'They are also easy to make and require (usually) minimal, if not zero, grocery shopping, assuming you keep a decently stocked pantry. I love, love, love these crispy pan-fried little guys.\r\n\r\nAnd as if the salmon burgers weren’t good enough already to eat on their own (which, um, they are), I need you to make this slaw to serve your salmon burgers in/on/around. It is nothing fancy – just a shredded cabbage, yogurt, herbs, garlic, and vinegar situation, but paired with the salmon burgers? The crispy-salty-tangy combo is an ON-POINT combo.', 'Orderpoz', '2023-03-16 22:02:21', '2023-03-16 22:02:21', NULL),
(3, 1, 'Browned Butter Chocolate', '2023-03-16-6412e262cd82c.png', 'Browned butter and brown sugar caramelly goodness, crispy edges, barely thick and soft centers, melty little puddles of chocolate chips and sprinkles of just enough salt to cut the sweetness and make you feel like you could probably eat 5 of them.\r\n\r\nMy first favorite thing about these browned butter chocolate chip cookies is that they combine the best of both the thin-cookie and thick-cookie worlds with that satisfying little crunch around the edge AND underbaked centers that are thick enough to really sink your teeth into. Best. Of. Both. Worlds.\r\n\r\nMy second favorite thing about these cookies is that they also just shine, and I mean really shine, with rich, deep, caramelly flavor thanks to a whole lot of browned butter.', 'Orderpoz', '2023-03-16 22:03:22', '2023-03-16 22:03:22', NULL);
