(1, '7777777777', 'orderpoz@gmail.com', '<p>Orderpoz is an app that we bring to you to deliver ease in placing food orders. All<br />\r\nthe top restaurants in your vicinity on a single dashboard, alongside thumbnail links<br />\r\nof the best deals and offers for the day, will brighten up your day.</p>\r\n\r\n<p><br />\r\nDining out is all about a positive customer experience. We take the experience<br />\r\nfurther by making food takeaway a breeze! So right before your guests arrive, you<br />\r\ncan go and collect the orders that you placed online on Orderpoz, packaged and<br />\r\nready to take away.</p>\r\n\r\n<p><br />\r\nTo encourage even more consumers to use our app, we make attractive discounts<br />\r\navailable on all orders. But, the discounts will stay the same even when you order at<br />\r\nour partner restaurants&#39; websites. We integrated our app into a host of partner<br />\r\nrestaurants&#39; websites.</p>\r\n\r\n<p><br />\r\nAt Orderpoz, we recognize that dining out often becomes a memorable experience<br />\r\nfor a consumer. We made it a point to include features to comfortably book tables<br />\r\nat your preferred restaurants, cafes, and pubs. This ensures that when you reach<br />\r\nthe venue in party mode, for a corporate meeting or a gentle outing with loved<br />\r\nones, there&rsquo;ll be no waiting times involved.</p>\r\n\r\n<p><br />\r\nOrderpoz, your preferred food ordering app makes app navigation exceptionally<br />\r\neasy so that you can easily find what you are looking for. Our platform is 100%<br />\r\nsecure and made using the globally prevalent best practices. If you happen to face<br />\r\nany issues with our services, we are delighted to put our best foot forward. Our<br />\r\ncustomer service is available 24/7 to cater to your requirements.</p>\r\n\r\n<p><br />\r\nSimilarly, if you are a restaurant owner, being associated with Orderpoz works in<br />\r\nseveral ways to forward your business. Online presence and smart branding will<br />\r\ndirectly translate to more orders, each day. Our app features state-of-the-art<br />\r\naesthetics, so marketing the fine meals that cook becomes easy. Sales-focused<br />\r\ndigital menus work to your advantage, while smart dashboards bring transparency<br />\r\nto all orders and their status, and the revenue that you generate.</p>\r\n\r\n<p><br />\r\nSelling with Orderpoz is refreshingly advantageous for partner restaurants. They are<br />\r\nnot required to pay any commission and also get their payments directly</p>', '<p><strong>Terms and Conditions (&quot;Terms&quot;) Our Terms and Conditions were last updated on [DATE]. Please read these terms and conditions carefully before using Our Service. Interpretation and Definitions Interpretation The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural. Definitions For the purposes of these Terms and Conditions:</strong></p>\r\n\r\n<p><strong>● &ldquo;Affiliate&rdquo; means an entity that controls, is controlled by or is under common control with a party, where &quot;control&quot; means ownership of 50% or more of the shares, equity interest or other securities entitled to vote for election of directors or other managing authority.</strong></p>\r\n\r\n<p><strong>● &ldquo;Account&rdquo; means a unique account created for You to access our Service or parts of our Service.</strong></p>\r\n\r\n<p><strong>● &ldquo;Company&rdquo; (referred to as either &quot;the Company&quot;, &quot;We&quot;, &quot;Us&quot; or &quot;Our&quot; in this Agreement) refers to [COMPANY_INFORMATION]. ● &ldquo;Country&rdquo; refers to [COMPANY_COUNTRY].</strong></p>\r\n\r\n<p><strong>● &ldquo;Content&rdquo; refers to content such as text, images, or other information that can be posted, uploaded, linked to or otherwise made available by You, regardless of the form of that content.</strong></p>\r\n\r\n<p><strong>● &ldquo;Device&rdquo; means any device that can access the Service such as a computer, a cellphone or a digital tablet.</strong></p>\r\n\r\n<p><strong>● &ldquo;Feedback&rdquo; means feedback, innovations or suggestions sent by You regarding the attributes, performance or features of our Service.</strong></p>\r\n\r\n<p><strong>● &ldquo;Products&rdquo; refer to the products or items offered for sale on the Service.</strong></p>\r\n\r\n<p><strong>● &ldquo;Orders&rdquo; mean a request by You to purchase Products from Us.</strong></p>\r\n\r\n<p><strong>● &ldquo;Promotions&rdquo; refer to contests, sweepstakes or other promotions offered through the Service.</strong></p>\r\n\r\n<p><strong>● &ldquo;Service&rdquo; refers to the Website. ● &ldquo;Terms and Conditions&rdquo; (also referred as &quot;Terms&quot;) mean these Terms and Conditions that form the entire agreement between You and the Company regarding the use of the Service. This Terms and Conditions Agreement was generated by TermsFeed Terms and Conditions Generator. ● &ldquo;Third-party Social Media Service&rdquo; means any services or content (including data, information, products or services) provided by a third-party that may be displayed, included or made available by the Service. ● &ldquo;Website&rdquo; refers to [WEBSITE_NAME], accessible from [WEBSITE_URL]ORDERPOZ</strong></p>', '<p><strong>\r\nThis Privacy Policy describes Our policies and procedures on the collection, use and disclosure of Your information when You use the Service and tells You about Your privacy rights and how the law protects You.\r\n\r\nWe use Your Personal data to provide and improve the Service. By using the Service, You agree to the collection and use of information in accordance with this Privacy Policy.\r\n\r\nInterpretation and Definitions\r\nInterpretation\r\nThe words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.\r\n\r\nDefinitions\r\nFor the purposes of this Privacy Policy:\r\n\r\nAccount means a unique account created for You to access our Service or parts of our Service.\r\nAffiliate means an entity that controls, is controlled by or is under common control with a party, where &quot;control&quot; means ownership of 50% or more of the shares, equity interest or other securities entitled to vote for election of directors or other managing authority.\r\nApplication means the software program provided by the Company downloaded by You on any electronic device, named Orderpoz (Orderpoz)\r\nCompany (referred to as either &quot;the Company&quot;, &quot;We&quot;, &quot;Us&quot; or &quot;Our&quot; in this Agreement) refers to Orderpoz.\r\nCountry refers to: Gujarat, India\r\nDevice means any device that can access the Service such as a computer, a cellphone or a digital tablet.\r\nPersonal Data is any information that relates to an identified or identifiable individual.\r\nService refers to the Application.\r\nService Provider means any natural or legal person who processes the data on behalf of the Company. It refers to third-party companies or individuals employed by the Company to facilitate the Service, to provide the Service on behalf of the Company, to perform services related to the Service or to assist the Company in analyzing how the Service is used.\r\nThird-party Social Media Service refers to any website or any social network website through which a User can log in or create an account to use the Service.\r\nUsage Data refers to data collected automatically, either generated by the use of the Service or from the Service infrastructure itself (for example, the duration of a page visit).\r\nYou means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.\r\n\r\nCollecting and Using Your Personal Data\r\nTypes of Data Collected\r\nPersonal Data\r\nWhile using Our Service, We may ask You to provide Us with certain personally identifiable information that can be used to contact or identify You. Personally identifiable information may include, but is not limited to:\r\nEmail address\r\nFirst name and last name\r\nPhone number\r\nAddress, State, Province, ZIP/Postal code, City\r\nUsage Data\r\nUsage Data is collected automatically when using the Service.\r\nUsage Data may include information such as Your Device&#39;s Internet Protocol address (e.g. IP address), browser type, browser version, the pages of our Service that You visit, the time and date of Your visit, the time spent on those pages, unique device identifiers and other diagnostic data.\r\nWhen You access the Service by or through a mobile device, We may collect certain information automatically, including, but not limited to, the type of mobile device You use, Your mobile device unique ID, the IP address of Your mobile device, Your mobile operating system, the type of mobile Internet browser You use, unique device identifiers and other diagnostic data.\r\nWe may also collect information that Your browser sends whenever You visit our Service or when You access the Service by or through a mobile device.\r\nInformation from Third-Party Social Media Services\r\nThe Company allows You to create an account and log in to use the Service through the following Third-party Social Media Services:\r\n&middot;Google\r\n&middot;Facebook\r\n&middot;Twitter\r\n&middot;LinkedIn\r\nIf You decide to register through or otherwise grant us access to a Third-Party Social Media Service, We may collect Personal data that is already associated with Your Third-Party Social Media Service&#39;s account, such as Your name, Your email address, Your activities or Your contact list associated with that account.\r\nYou may also have the option of sharing additional information with the Company through Your Third-Party Social Media Service&#39;s account. If You choose to provide such information and Personal Data, during registration or otherwise, You are giving the Company permission to use, share, and store it in a manner consistent with this Privacy Policy.\r\n\r\nInformation Collected while Using the Application\r\nWhile using Our Application, in order to provide features of Our Application, We may collect, with Your prior permission:\r\nInformation regarding your location\r\nPictures and other information from your Device&#39;s camera and photo library\r\nWe use this information to provide features of Our Service, to improve and customize Our Service. The information may be uploaded to the Company&#39;s servers and/or a Service Provider&#39;s server or it may be simply stored on Your device.\r\nYou can enable or disable access to this information at any time, through Your Device settings.\r\n\r\nUse of Your Personal Data\r\nThe Company may use Personal Data for the following purposes:\r\nTo provide and maintain our Service, including to monitor the usage of our Service.\r\nTo manage Your Account: to manage Your registration as a user of the Service. The Personal Data You provide can give You access to different functionalities of the Service that are available to You as a registered user.\r\nFor the performance of a contract: the development, compliance and undertaking of the purchase contract for the products, items or services You have purchased or of any other contract with Us through the Service.\r\nTo contact You: To contact You by email, telephone calls, SMS, or other equivalent forms of electronic communication, such as a mobile application&#39;s push notifications regarding updates or informative communications related to the functionalities, products or contracted services, including the security updates, when necessary or reasonable for their implementation.\r\nTo provide You with news, special offers and general information about other goods, services and events which we offer that are similar to those that you have already purchased or enquired about unless You have opted not to receive such information.\r\nTo manage Your requests: To attend and manage Your requests to Us.\r\nFor business transfers: We may use Your information to evaluate or conduct a merger, divestiture, restructuring, reorganization, dissolution, or other sale or transfer of some or all of Our assets, whether as a going concern or as part of bankruptcy, liquidation, or similar proceeding, in which Personal Data held by Us about our Service users is among the assets transferred.\r\nFor other purposes: We may use Your information for other purposes, such as data analysis, identifying usage trends, determining the effectiveness of our promotional campaigns and to evaluate and improve our Service, products, services, marketing and your experience.\r\n\r\nWe may share Your personal information in the following situations:\r\n&middot;With Service Providers: We may share Your personal information with Service Providers to monitor and analyze the use of our Service, to contact You.\r\n&middot;For business transfers: We may share or transfer Your personal information in connection with, or during negotiations of, any merger, sale of Company assets, financing, or acquisition of all or a portion of Our business to another company.\r\n&middot;With Affiliates: We may share Your information with Our affiliates, in which case we will require those affiliates to honor this Privacy Policy. Affiliates include Our parent company and any other subsidiaries, joint venture partners or other companies that We control or that are under common control with Us.\r\n&middot;With business partners: We may share Your information with Our business partners to offer You certain products, services or promotions.\r\n&middot;With other users: when You share personal information or otherwise interact in the public areas with other users, such information may be viewed by all users and may be publicly distributed outside. If You interact with other users or register through a Third-Party Social Media Service, Your contacts on the Third-Party Social Media Service may see Your name, profile, pictures and description of Your activity. Similarly, other users will be able to view descriptions of Your activity, communicate with You and view Your profile.\r\n&middot;With Your consent: We may disclose Your personal information for any other purpose with Your consent.\r\n\r\nRetention of Your Personal Data\r\nThe Company will retain Your Personal Data only for as long as is necessary for the purposes set out in this Privacy Policy. We will retain and use Your Personal Data to the extent necessary to comply with our legal obligations (for example, if we are required to retain your data to comply with applicable laws), resolve disputes, and enforce our legal agreements and policies.\r\nThe Company will also retain Usage Data for internal analysis purposes. Usage Data is generally retained for a shorter period of time, except when this data is used to strengthen the security or to improve the functionality of Our Service, or We are legally obligated to retain this data for longer time periods.\r\n\r\nTransfer of Your Personal Data\r\nYour information, including Personal Data, is processed at the Company&#39;s operating offices and in any other places where the parties involved in the processing are located. It means that this information may be transferred to &mdash; and maintained on &mdash; computers located outside of Your state, province, country or other governmental jurisdiction where the data protection laws may differ than those from Your jurisdiction.\r\nYour consent to this Privacy Policy followed by Your submission of such information represents Your agreement to that transfer.\r\nThe Company will take all steps reasonably necessary to ensure that Your data is treated securely and in accordance with this Privacy Policy and no transfer of Your Personal Data will take place to an organization or a country unless there are adequate controls in place including the security of Your data and other personal information.\r\n\r\nDelete Your Personal Data\r\nYou have the right to delete or request that We assist in deleting the Personal Data that We have collected about You.\r\nOur Service may give You the ability to delete certain information about You from within the Service.\r\nYou may update, amend, or delete Your information at any time by signing in to Your Account, if you have one, and visiting the account settings section that allows you to manage Your personal information. You may also contact Us to request access to, correct, or delete any personal information that You have provided to Us.\r\nPlease note, however, that We may need to retain certain information when we have a legal obligation or lawful basis to do so.\r\nDisclosure of Your Personal Data\r\nBusiness Transactions\r\nIf the Company is involved in a merger, acquisition or asset sale, Your Personal Data may be transferred. We will provide notice before Your Personal Data is transferred and becomes subject to a different Privacy Policy.\r\nLaw enforcement\r\nUnder certain circumstances, the Company may be required to disclose Your Personal Data if required to do so by law or in response to valid requests by public authorities (e.g. a court or a government agency).\r\n\r\nOther legal requirements\r\nThe Company may disclose Your Personal Data in the good faith belief that such action is necessary to:\r\n&middot;Comply with a legal obligation\r\n&middot;Protect and defend the rights or property of the Company\r\n&middot;Prevent or investigate possible wrongdoing in connection with the Service\r\n&middot;Protect the personal safety of Users of the Service or the public\r\n&middot;Protect against legal liability\r\n\r\nSecurity of Your Personal Data\r\nThe security of Your Personal Data is important to Us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While We strive to use commercially acceptable means to protect Your Personal Data, We cannot guarantee its absolute security.\r\n\r\nChildren&#39;s Privacy\r\nOur Service does not address anyone under the age of 18. We do not knowingly collect personally identifiable information from anyone under the age of 18. If You are a parent or guardian and You are aware that Your child has provided Us with Personal Data, please contact Us. If We become aware that We have collected Personal Data from anyone under the age of 18 without verification of parental consent, We take steps to remove that information from Our servers.\r\nIf We need to rely on consent as a legal basis for processing Your information and Your country requires consent from a parent, We may require Your parent&#39;s consent before We collect and use that information.\r\n\r\nLinks to Other Websites\r\nOur Service may contain links to other websites that are not operated by Us. If You click on a third party link, You will be directed to that third party&#39;s site. We strongly advise You to review the Privacy Policy of every site You visit.\r\nWe have no control over and assume no responsibility for the content, privacy policies or practices of any third party sites or services.\r\n\r\nChanges to this Privacy Policy\r\nWe may update Our Privacy Policy from time to time. We will notify You of any changes by posting the new Privacy Policy on this page.\r\nWe will let You know via email and/or a prominent notice on Our Service, prior to the change becoming effective and update the &quot;Last updated&quot; date at the top of this Privacy Policy.\r\nYou are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.\r\n\r\nContact Us\r\nIf you have any questions about this Privacy Policy, You can contact us:\r\nBy email: singhraja219@gmail.com</strong></