(87, 26, 1, 32, 50, 0, 'Indian Chicken Curry (Murgh Kari)', '250.00', '2023-04-04-642bc1652fab4.png', 'Murgh Kari makes use of a potent spice blend that includes garam masala, coriander, turmeric, and cayenne pepper. Tomato, yogurt, and onion are also essential ingredients in this classic Indian main dish. Fresh minced garlic and ginger lend a pleasant sharpness.\r\n\r\nOur top-rated recipe uses skinless, boneless chicken breasts for a tender, evenly cooked result, but other cuts like tenderloin and thigh make suitable substitutions.', '2023-04-04 06:19:17', '2023-04-04 06:19:17'),
(88, 26, 1, 31, 51, 1, 'Gobi Manchurian', '100.00', '2023-04-04-642bc1e8d6e98.png', 'Gobi Manchurian is a Indo Chinese dish.\r\n\r\nGobi is cauliflower, so for this dish cauliflower florets are first fried by tossing them in a flour-cornstarch batter which makes them crispy.\r\n\r\nAnd then they are tossed in a manchurian sauce which is made with soy sauce, vinegar and is slightly sweet and tangy. It can also be spicy if you add a lot of hot sauce which I don’t.\r\n\r\nThis dish is usually served in two ways- the dry version and the one with sauce (gravy version).\r\n\r\nThe dry version is usually served as an appetizer and the one with gravy as a main meal with noodles or rice.\r\n\r\nMy version is somewhere between the two, it doesn’t really have a lot of gravy but it’s not completely dry either.\r\n\r\nSo you can serve it both ways!', '2023-04-04 06:21:28', '2023-04-04 06:21:28'),
